import React from "react";
import { Card, Grid } from "semantic-ui-react";
import "semantic-ui-css/semantic.min.css";
import "./../App.css";

function Search({ data }) {
  return (
    <>
      <h1>Search results</h1>
      <br></br>
      <Grid columns={3}>
        {data.map((people, i) => {
          return (
            <Grid.Column key={i}>
              <Card>
                <Card.Content>
                  <Card.Header>{people.resultsname}</Card.Header>
                  <Card.Description>
                    <strong>Eye Color</strong>
                    <p>{people.resultseye_color}</p>
                    <strong>Height</strong>
                    <p>{people.resultsheight}</p>
                    <strong>Species</strong>
                    <p>{people.resultsspecies}</p>
                  </Card.Description>
                </Card.Content>
              </Card>
            </Grid.Column>
          );
        })}
      </Grid>
    </>
  );
}

export default Search;
